ChainLinkOracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.5;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract ChainLinkOracle {
    AggregatorV3Interface internal priceFeed;
    address oracleAddressListen;

    constructor(address _oracleAddressListen)  {
        oracleAddressListen = _oracleAddressListen;
        priceFeed = AggregatorV3Interface(oracleAddressListen);
    }

    function getLatestPrice() public view returns (int) {
        (,int price,,,) = priceFeed.latestRoundData();
        return price;
    }

    function getUSDPrice() public view returns(uint256) {
        int weth_usd_price = getLatestPrice();
        return uint256(((1 * (10 ** 8)) * (1 * (10 ** 18))) / weth_usd_price);
    }

}

@chainlink/contracts/src/v0.8/interfaces.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  // getRoundData and latestRoundData should both raise "No data present"
  // if they do not have data to report, instead of returning unset values
  // which could be misinterpreted as actual reported values.
  function getRoundData(uint80 _roundId)
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );
}

